import * as React from 'react';
import Paper from '@mui/material/Paper';
import Stack from '@mui/material/Stack';
import {styled} from '@mui/material/styles';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import countries from "./CountrySelector";
import Autocomplete from "@mui/material/Autocomplete";
import "./profile.css";
import AdapterDateFns from '@mui/lab/AdapterDateFns';
import LocalizationProvider from '@mui/lab/LocalizationProvider';
import DatePicker from '@mui/lab/DatePicker';
import {
    Button,
    FormControl,
    FormControlLabel,
    FormLabel,
    IconButton,
    InputAdornment,
    InputLabel,
    List,
    ListItem,
    ListItemText,
    OutlinedInput,
    Radio,
    RadioGroup,
    Typography
} from "@mui/material";
import * as PropTypes from "prop-types";
import {Link} from 'react-router-dom';

const Item = styled(Paper)(({ theme }) => ({
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

export default function EditResearcherProfile(date, dateToCompare) {

  return (
      // <div>
        <List sx={{ width: '100%', color: 'background.paper' }}>
          <ListItem alignItems="flex-start">
            <ListItemText
              primaryTypographyProps={{fontSize: "30px", fontWeight: "bold"}} primary="Edit Profile"
            />
          </ListItem>
        <Box
            component="form"
            sx={{
              '& .MuiTextField-root': { m: 1, width: '100%' },
            }}
            noValidate
            autoComplete="off"
        >
        </Box>

        <Stack direction="column" spacing={4} width="50%" >
            <TextField
                required
                require fullWidth
                id="outlined-required"
                label="Username"
                name="username"
                floatingLabelText="Your Username"
                inputProps={{style: {minHeight: 25}}}
            />

          </Stack>

        <Stack direction="row" spacing={5} marginTop='4%'>

            <TextField
                required
                fullWidth
                id="outlined-required"
                label="Password"
                format="phone"
                placeholder="New Password"
                inputProps={{style: {minHeight: 25}}}
            />
          </Stack>

          <ListItem alignItems="flex-start">
              <ListItemText
              secondary={
                  <React.Fragment>
                    <Typography
                        sx={{ display: 'inline' }}
                        component="span"
                        variant="body2"
                        color="text.primary"
                    >

                    </Typography>
                    {"The information below is optional but will help trial sponsors determine your"
                    + " eligibility."}
                  </React.Fragment>
                }
                />
            </ListItem>

            <Stack direction={"column"} marginBottom={5} maxWidth='50%'>

          <TextField
              label="Phone Number"
              id="outlined-start-adornment"
              sx={{marginTop:3 }}
              InputProps={{
                startAdornment: <InputAdornment position="end"></InputAdornment>,
              }}
          />

          <TextField
              label="Height"
              id="outlined-start-adornment"
              sx={{marginTop: 3}}
              InputProps={{
                startAdornment: <InputAdornment position="end">cm</InputAdornment>,
              }}
          />
          <TextField
              fullWidth
              id="outlined-required"
              sx={{marginTop: 3}}
              label="Blood Group"
              inputProps={{style: {minHeight: 25}}}
          />
              <TextField
                  fullWidth
                  id="outlined-required"
                  sx={{marginTop: 3}}
                  label="Country"
                  inputProps={{style: {minHeight: 25}}}
              />

          </Stack>

          <Stack direction="row" paddingLeft='40%' paddingTop="3%" spacing='5%'>
            <Button variant="contained" color="success" size={"large"}>
              Save Changes
            </Button>
            <Button variant="outlined" color="error" size={"large"}>
              Cancel
            </Button>

          </Stack>

        </List>
  );
}
